import './App.css';
import theImage from './img/wpis1.jpg'

function Card(props) {
    return (
        <main className='container'>
            <div className='card-blog'>
                <h3>{props.title}</h3>
                <p className='card-blog-text'>{props.description}</p>
                <img src={theImage} alt={props.alt}/>
            </div>
        </main>
    );
}

export default Card;
